import Header from "../components/header";
import Main from "../components/main";
import Article from "../components/article";

const Home = () => {
  return (
    <>
      {/* start header with image background */}
      <Header />
      {/* this line the header of page ends  */}
      {/* start main  */}
      <Main />
      {/* end main  */}
      {/* start article */}
      <Article />
      {/* end article */}
      {/* start section */}

      {/* end section */}
      {/* start footer */}
      <footer>
        <p>Copyright 2017. All Rights Reserved.</p>
      </footer>
      {/* end footer */}
    </>
  );
};
export default Home;
